import json

def default(obj):
    if not isinstance(obj, dict):
        return obj
    seen = {}
    for (key, value) in obj.items():
        if isinstance(value, dict):
            if id(value) not in seen:
                obj[key] = None
            else:
                seen[id(value)] = value
                obj[key] = default(value)
    return obj
